import React from 'react';
import './NotesList.css';

const notesList = ({notes, editNote, deleteNote}) => {
  return notes.length ? (
    notes.map(note => <div className="note" key={note.id}>{note.note}<span className="note-edit" onClick={() => editNote(note.id)}><button /></span><span className="note-delete" onClick={() => deleteNote(note.id)}><button /></span></div>)
  ) : null
}


export default notesList;
